import React, { Component } from 'react';
import Header from '../Header';
import './index.css';
import BackgroundImage from '../Images/couple2.jpg';

class SignUp extends Component {
	constructor(props) {
		super(props);
		this.state = {
			firstName: '',
			lastName: '',
			username: '',
			emailAdress: '',
			password: '',
			confirmPassword: ''
		};
	}

	render() {
		return (
			<div className="main">

				<div className="formmain">
					<div id="signuphead">
						X
					</div>
					<div className="formpart">
						<div id="signuplogo">MATCHA</div>
						<div id="signup">Get Started</div>
						<form>
							<input
								type="text"
								placeholder="First Name"
							/>
							<input
								type="text"
								placeholder="Last Name"
							/>
							<input
								type="text"
								placeholder="Username"
							/>
							<input
								type="text"
								placeholder="Email Adress"
							/>
							<input
								type="password"
								placeholder="Password"
							/>
							<input
								type="password"
								placeholder="Confirm Password"
							/>
							<button id="signupsubmit" type="submit">Sign Up for Free</button>
						</form>
					</div>
				</div>
			</div>
		);
	}
}

export default SignUp;
